import React, { useEffect, useState } from "react";

const backendURL = "http://localhost:5000";

function Reporting() {
  const [sales, setSales] = useState([]);
  const [products, setProducts] = useState([]);
  const [stockTransactions, setStockTransactions] = useState([]);

  const fetchData = async () => {
    try {
      const resSales = await fetch(`${backendURL}/sales`);
      const salesData = await resSales.json();
      setSales(salesData);

      const resProducts = await fetch(`${backendURL}/products`);
      const productsData = await resProducts.json();
      setProducts(productsData);

      const resStock = await fetch(`${backendURL}/stock-transactions`);
      const stockData = await resStock.json();
      setStockTransactions(stockData);
    } catch (err) {
      console.error("Error fetching reporting data:", err);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  // Calculate total revenue
  const totalRevenue = sales.reduce(
    (sum, s) => sum + (s.price || 0) * s.quantity,
    0
  );

  // Most-selling products
  const productSalesMap = {};
  sales.forEach((s) => {
    productSalesMap[s.productName] = (productSalesMap[s.productName] || 0) + s.quantity;
  });

  const mostSellingProducts = Object.entries(productSalesMap)
    .sort((a, b) => b[1] - a[1])
    .slice(0, 5); // top 5

  const lowStockProducts = products.filter((p) => p.quantity < 10);

  return (
    <div>
      <h1>Reporting Module</h1>

      <div style={{ marginBottom: "20px" }}>
        <h2>Sales Summary</h2>
        <p>Total Sales Transactions: {sales.length}</p>
        <p>Total Revenue: ${totalRevenue}</p>
      </div>

      <div style={{ marginBottom: "20px" }}>
        <h2>Most Selling Products</h2>
        {mostSellingProducts.length > 0 ? (
          <ul>
            {mostSellingProducts.map(([name, quantity]) => (
              <li key={name}>
                {name} - Sold: {quantity}
              </li>
            ))}
          </ul>
        ) : (
          <p>No sales yet.</p>
        )}
      </div>

      <div style={{ marginBottom: "20px" }}>
        <h2>Low Stock Products</h2>
        {lowStockProducts.length > 0 ? (
          <ul>
            {lowStockProducts.map((p) => (
              <li key={p.id}>
                {p.name} - Quantity: {p.quantity}
              </li>
            ))}
          </ul>
        ) : (
          <p>No low stock products.</p>
        )}
      </div>

      <div>
        <h2>Recent Stock Additions</h2>
        <table>
          <thead>
            <tr>
              <th>Product</th>
              <th>Quantity Added</th>
              <th>Date</th>
            </tr>
          </thead>
          <tbody>
            {stockTransactions
              .sort((a, b) => new Date(b.date) - new Date(a.date))
              .map((t) => (
                <tr key={t.id}>
                  <td>{t.productName}</td>
                  <td>{t.quantity}</td>
                  <td>{new Date(t.date).toLocaleString()}</td>
                </tr>
              ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Reporting;
